selector_to_html = {"a[href=\"barcode.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Start Setup<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">End Setup<a class=\"headerlink\" href=\"#end-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"faq.html#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1: The scan is successful, the buzzer sounds once, but no data is uploaded?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong> The scanner has entered storage mode and needs to scan <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Normal Mode</span></a> to recover.</p>", "a[href=\"barcode.html#block-barcodes-with-urls\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Block Barcodes With URLs<a class=\"headerlink\" href=\"#block-barcodes-with-urls\" title=\"Link to this heading\">#</a></h2><p>Block scanning of URL QR codes starting with <code class=\"docutils literal notranslate\"><span class=\"pre\">http://</span></code>, <code class=\"docutils literal notranslate\"><span class=\"pre\">https://</span></code></p>", "a[href=\"barcode.html#enable-all-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Enable All Symbologies<a class=\"headerlink\" href=\"#enable-all-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wired.html#usb-keyboard-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">USB Keyboard Speed<a class=\"headerlink\" href=\"#usb-keyboard-speed\" title=\"Link to this heading\">#</a></h2><h3>Get Keyboard Speed<a class=\"headerlink\" href=\"#get-keyboard-speed\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wired.html#usb-hid-multi-key-send-set\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">USB HID Multi-Key Send Set<a class=\"headerlink\" href=\"#usb-hid-multi-key-send-set\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html#appendix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Appendix<a class=\"headerlink\" href=\"#appendix\" title=\"Link to this heading\">#</a></h2><h3>Numeric Bar Codes<a class=\"headerlink\" href=\"#numeric-bar-codes\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Key Trigger Mode<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Press the button to trigger scanning, and release the button to end scanning. Scanning ends when the scan is successful or the reading time exceeds the single reading time.</p>", "a[href=\"process.html#quick-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Quick Setup<a class=\"headerlink\" href=\"#quick-setup\" title=\"Link to this heading\">#</a></h2><h3>Add Prefix<a class=\"headerlink\" href=\"#id3\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wired.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Wired Mode<a class=\"headerlink\" href=\"#wired-mode\" title=\"Link to this heading\">#</a></h1><h2>Transmission Mode<a class=\"headerlink\" href=\"#transmission-mode\" title=\"Link to this heading\">#</a></h2><h3>USB Cable as Keyboard<a class=\"headerlink\" href=\"#usb-cable-as-keyboard\" title=\"Link to this heading\">#</a></h3>", "a[href=\"working.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Working Mode<a class=\"headerlink\" href=\"#working-mode\" title=\"Link to this heading\">#</a></h1><p>In the working area outside the range of the 2.4G receiver or Bluetooth signal, you can activate the storage mode of the scanner by following the steps described below. In this mode, all scanned data will be stored directly in the scanner. Before uploading the data, it will be permanently saved in the scanner so that you can upload the data when the scanner is in the receiving signal range.</p>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Auto Sensing Mode<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>In the auto sensing mode, the scanner will detect the brightness of the surrounding environment. When the brightness changes, the scan is triggered. The scan ends when the scan is successful or the scan time exceeds the single working time. Regardless of whether the last scan was successful or failed, the brightness of the surrounding environment will be detected again.</p>", "a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Continuous Mode<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>The scanner works continuously. If the scan is successful or the scan time exceeds the single working time, the current scan ends. If the time exceeds the specified time, the next scan is automatically triggered.</p>", "a[href=\"faq.html#question-5-scan-successful-uploaded-data-incorrect\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 5:Scan successful, uploaded data incorrect?<a class=\"headerlink\" href=\"#question-5-scan-successful-uploaded-data-incorrect\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong></p>", "a[href=\"working.html#storage-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Storage Mode<a class=\"headerlink\" href=\"#storage-mode\" title=\"Link to this heading\">#</a></h2><h3>Data Upload<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Get Firmware Version<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#sleep-time\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Sleep Time<a class=\"headerlink\" href=\"#sleep-time\" title=\"Link to this heading\">#</a></h2><p>By scanning the following setting code, you can set the scanner to enter sleep mode after a certain period of time when no code is scanned, so as to reduce power consumption.</p>", "a[href=\"wired.html#transmission-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Transmission Mode<a class=\"headerlink\" href=\"#transmission-mode\" title=\"Link to this heading\">#</a></h2><h3>USB Cable as Keyboard<a class=\"headerlink\" href=\"#usb-cable-as-keyboard\" title=\"Link to this heading\">#</a></h3>", "a[href=\"bluetooth.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth Mode<a class=\"headerlink\" href=\"#bluetooth-mode\" title=\"Link to this heading\">#</a></h1>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Volume Settings<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><p>Scan the corresponding setting code to turn on/off the sound prompt of the scanner</p>", "a[href=\"faq.html#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2:The scanner scans successfully, beeps twice, and can upload data normally. What is going on?<a class=\"headerlink\" href=\"#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong> The battery of the scanner gun is low and it prompts that it needs to be recharged.</p>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Keyboard Settings<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Case Settings<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normal<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"faq.html#question-4-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 4:The scanner beeps five times when a button is pressed. How can I solve this problem?<a class=\"headerlink\" href=\"#question-4-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong> The battery is low and needs to be charged before it can be used again.</p>", "a[href=\"keyboard.html#case-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Case Settings<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normal<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html#output-format\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Output Format<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><p>To change the Scan Data Transmission Format, scan one of the eight bar codes corresponding to the desired format.</p>", "a[href=\"wireless.html#high-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">High Speed<a class=\"headerlink\" href=\"#high-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html#low-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Low Speed<a class=\"headerlink\" href=\"#low-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Wireless Mode<a class=\"headerlink\" href=\"#wireless-mode\" title=\"Link to this heading\">#</a></h1><p>This mode uses the 2.4GHz frequency band for data transmission and relies on radio frequency (RF) technology, which connects to the computer via a USB receiver and allows the scanner to move freely within a certain distance.</p>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Keyboard Language<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Get Current Keyboard Language<a class=\"headerlink\" href=\"#get-current-keyboard-language\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html#prefix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Prefix<a class=\"headerlink\" href=\"#prefix\" title=\"Link to this heading\">#</a></h2><h3>Add Prefix<a class=\"headerlink\" href=\"#add-prefix\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Start Setup<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">End Setup<a class=\"headerlink\" href=\"#end-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Scan Mode<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Start Setup<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#gy-60u-wireless-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><strong>GY-60U</strong> Wireless Scanner Quick Setup Guide<a class=\"headerlink\" href=\"#gy-60u-wireless-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"faq.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">FAQ<a class=\"headerlink\" href=\"#faq\" title=\"Link to this heading\">#</a></h1><h2>Question 1: The scan is successful, the buzzer sounds once, but no data is uploaded?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong> The scanner has entered storage mode and needs to scan <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Normal Mode</span></a> to recover.</p>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Restore Default Settings<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>When an unknown error occurs on the scanner, you can reset the scanner by restoring the default settings.</p>", "a[href=\"process.html#hide-set\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Hide Set<a class=\"headerlink\" href=\"#hide-set\" title=\"Link to this heading\">#</a></h2><h3>Hide Barcode Start Chars<a class=\"headerlink\" href=\"#hide-barcode-start-chars\" title=\"Link to this heading\">#</a></h3>", "a[href=\"faq.html#question-3-the-scanner-scans-successfully-beeps-three-times-and-fails-to-upload-data-how-can-i-solve-this-problem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 3:The scanner scans successfully, beeps three times, and fails to upload data. How can I solve this problem?<a class=\"headerlink\" href=\"#question-3-the-scanner-scans-successfully-beeps-three-times-and-fails-to-upload-data-how-can-i-solve-this-problem\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong></p>", "a[href=\"barcode.html#only-enable-2d-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Only Enable 2D Symbologies<a class=\"headerlink\" href=\"#only-enable-2d-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html#end-character-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">End Character Settings<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>The end character is added after the decoded data in the format of decoded data + end character.</p>", "a[href=\"character.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Start Setup<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Terminator<a class=\"headerlink\" href=\"#terminator\" title=\"Link to this heading\">#</a></h1><h2>Start Setup<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Data Editing<a class=\"headerlink\" href=\"#data-editing\" title=\"Link to this heading\">#</a></h1><h2>Output Format<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><p>To change the Scan Data Transmission Format, scan one of the eight bar codes corresponding to the desired format.</p>", "a[href=\"working.html#normal-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Normal Mode<a class=\"headerlink\" href=\"#normal-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#battery-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Battery Information<a class=\"headerlink\" href=\"#battery-information\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wired.html#automatic-selection-of-wired-wireless-transmission\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Automatic Selection Of Wired/Wireless Transmission<a class=\"headerlink\" href=\"#automatic-selection-of-wired-wireless-transmission\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">System Settings<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Restore Default Settings<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>When an unknown error occurs on the scanner, you can reset the scanner by restoring the default settings.</p>", "a[href=\"barcode.html#only-enable-1d-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Only Enable 1D Symbologies<a class=\"headerlink\" href=\"#only-enable-1d-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html#receiver-keyboard-transmission-speed1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Receiver Keyboard Transmission Speed<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#receiver-keyboard-transmission-speed1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html#medium-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Medium Speed<a class=\"headerlink\" href=\"#medium-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html#suffix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Suffix<a class=\"headerlink\" href=\"#suffix\" title=\"Link to this heading\">#</a></h2><h3>Add Suffix<a class=\"headerlink\" href=\"#add-suffix\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">End Setup<a class=\"headerlink\" href=\"#end-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html#one-to-one-pairing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">One-to-One Pairing<a class=\"headerlink\" href=\"#one-to-one-pairing\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Symbologies<a class=\"headerlink\" href=\"#symbologies\" title=\"Link to this heading\">#</a></h1><h2>Start Setup<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
